import React, { Component } from "react";
import './Contact.css';

class Contact extends Component {
    render() {
        return (
            <div className="container-fluid card">
                <h1 className=" text-white text-center display-1 py-3" style={{fontFamily: "cinematic"}}> For Contact</h1>
                <div className="row">
                    <div className="col-md-4">
                    <img
                        src="/images/Free_Vector___Flat_design_illustration_customer_support-removebg-preview.png"
                        width="300px"
                        height="300px"
                        alt="Contact"
                    />
                    </div>
                    <div className="col-md-8">
                        
                    </div>
                </div>
            </div>
        );
    }
}

export default Contact;
